runtime: java11
inbound_services:
- warmup
auto_id_policy: default
beta_settings:
  'source_reference': 'https://github.com/Batalaia/App-Individual.git#ad1fd4217ecb9b07b445a59c0b7b497f22665b04'
handlers:
- url: (/.*/)
  static_files: __static__\1welcome.html
  upload: __NOT_USED__
  require_matching_file: True
  login: optional
  secure: optional
- url: (/)
  static_files: __static__\1welcome.html
  upload: __NOT_USED__
  require_matching_file: True
  login: optional
  secure: optional
- url: (/.*\.cur)
